"use client"

import { useEffect, useState } from "react"

import { TemplateImage } from "@/types/templates"

import { useTemplate } from "./template-context"

export const useTemplateImage = () => {
  const [templateImage, setTemplateImage] = useState<TemplateImage | null>(null)

  const { template } = useTemplate()

  useEffect(() => {
    const fetchData = async () => {
      const response = await fetch(`/api/images/${template?.image}`)
      const { data } = await response.json()
      setTemplateImage(data)
    }

    if (process.env.NODE_ENV !== "development" && template) {
      fetchData()
    } else {
      setTemplateImage(getDummyData())
    }
  }, [template])

  return templateImage
    ? {
        ...templateImage,
        url: `data:${templateImage.type};base64,${templateImage.base64Data}`,
      }
    : null
}

function getDummyData() {
  return {
    id: "abe5fe00-c003-4951-9ec7-5a454e8b0dc1",
    name: "Lupita Image.png",
    type: "image/png",
    folderName: null,
    sizeBytes: 345497,
    base64Data:
      "",
  }
}
